INSERT INTO `v1_f3b5fc8bcc36c9c9b1fa46f83e0267367dc98a521141744b7e55cee2deea65f5` VALUES (1033501, 1, "オラの食材とあんちゃんの腕……\nこれは二人の共同作業ってことに……\nな、なんでもねぇ！\n気にしねぇでけろ！", 0, 103311, 0, 5, 1033501043, 1, 11, "");
