INSERT INTO `v1_f3b5fc8bcc36c9c9b1fa46f83e0267367dc98a521141744b7e55cee2deea65f5` VALUES (1052501, 1, "素敵なケーキをありがとう！\nまさかこんな盛大に\nお祝いしてもらえるなんて\n思わなかったわ！", 0, 105211, 0, 6, 1052501040, 1, 11, "");
INSERT INTO `v1_f3b5fc8bcc36c9c9b1fa46f83e0267367dc98a521141744b7e55cee2deea65f5` VALUES (1052501, "", "", "", 0, "", "", 1052501041, "", 91, "");
INSERT INTO `v1_f3b5fc8bcc36c9c9b1fa46f83e0267367dc98a521141744b7e55cee2deea65f5` VALUES (1052501, 0, "vo_adv_1052501_001", "", "vo_adv_1052501", "", 0, 1052501042, "", 21, "");
INSERT INTO `v1_f3b5fc8bcc36c9c9b1fa46f83e0267367dc98a521141744b7e55cee2deea65f5` VALUES (1052501, 1, "おめでとうって言ってもらえるだけでも\nうれしいのに、手作りのケーキまで……\n私、あなたにいろんなものを\nもらってばっかりね。", 0, 105211, 0, 6, 1052501043, 1, 11, "");
INSERT INTO `v1_f3b5fc8bcc36c9c9b1fa46f83e0267367dc98a521141744b7e55cee2deea65f5` VALUES (1052501, "", "", "", 0, "", "", 1052501044, "", 91, "");
INSERT INTO `v1_f3b5fc8bcc36c9c9b1fa46f83e0267367dc98a521141744b7e55cee2deea65f5` VALUES (1052501, 0, "vo_adv_1052501_002", "", "vo_adv_1052501", "", 0, 1052501045, "", 21, "");
INSERT INTO `v1_f3b5fc8bcc36c9c9b1fa46f83e0267367dc98a521141744b7e55cee2deea65f5` VALUES (1052501, 1, "少しでもお返ししたいけど……\nあなたは何かしてほしいことはある？\nえ？　私の誕生日だから私が\n喜んでくれたらうれしい……？", 0, 105211, 0, 5, 1052501046, 1, 11, "");
INSERT INTO `v1_f3b5fc8bcc36c9c9b1fa46f83e0267367dc98a521141744b7e55cee2deea65f5` VALUES (1052501, "", "", "", 0, "", "", 1052501047, "", 91, "");
INSERT INTO `v1_f3b5fc8bcc36c9c9b1fa46f83e0267367dc98a521141744b7e55cee2deea65f5` VALUES (1052501, 0, "vo_adv_1052501_003", "", "vo_adv_1052501", "", 0, 1052501048, "", 21, "");
INSERT INTO `v1_f3b5fc8bcc36c9c9b1fa46f83e0267367dc98a521141744b7e55cee2deea65f5` VALUES (1052501, 1, "私、もう十分に喜んでるわ！\nでも、あなたのそんな言葉を聞いたら\nもう少しわがままを\n言いたくなっちゃうわ。", 0, 105211, 0, 5, 1052501049, 1, 11, "");
INSERT INTO `v1_f3b5fc8bcc36c9c9b1fa46f83e0267367dc98a521141744b7e55cee2deea65f5` VALUES (1052501, "", "", "", 0, "", "", 1052501050, "", 91, "");
INSERT INTO `v1_f3b5fc8bcc36c9c9b1fa46f83e0267367dc98a521141744b7e55cee2deea65f5` VALUES (1052501, 0, "vo_adv_1052501_004", "", "vo_adv_1052501", "", 0, 1052501051, "", 21, "");
INSERT INTO `v1_f3b5fc8bcc36c9c9b1fa46f83e0267367dc98a521141744b7e55cee2deea65f5` VALUES (1052501, 1, "ケーキをあーんしてもらってもいい？\n一口だけ、一口だけでいいから！\nいいの？　ありがとう！\n最高の誕生日だわ！", 0, 105211, 0, 4, 1052501052, 1, 11, "");
